var counter = 0;
function changeBG(){
    var imgs = [
        "url(https://cdn.pixabay.com/photo/2017/08/30/01/05/milky-way-2695569__340.jpg)",
        "url(https://images.pexels.com/photos/36717/amazing-animal-beautiful-beautifull.jpg?auto=compress&cs=tinysrgb&dpr=1&w=500)",
        "url(https://i.pinimg.com/originals/0d/8e/02/0d8e0215230f829053d078247b5d5bec.jpg)",
        "url(data:image/jpeg;base64,)",
        "url(data:image/jpeg;base64,)",
        "url(https://ae01.alicdn.com/kf/HTB1pkl2gv9TBuNjy0Fcq6zeiFXar/mural-wallpaper-customize-wallpapers-for-living-room-3D-balcony-beautiful-scenery-landscape-TV-background-wall.jpg_960x960.jpg)",
        "url(https://coxcreativestudios.com/wp-content/uploads/2017/11/Scenery-Wallpaper-5.jpg)",
        "url(https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSMU5BPKnLURLgk78m46sGV1VEWozK0IpxkQA&usqp=CAU)"
      ]
    
    if(counter === imgs.length) counter = 0;
    $("body").css("background-image", imgs[counter]);

    counter++;
}
  
  setInterval(changeBG, 2000);